import React from 'react';
import styled from 'styled-components';


const Activities =({imgsrc})=>{
    return(
      <div style={{
          margin:'3%',
          width:'100%',
          height:'15%',
          position:'flex',
          background: 'white',
          borderRadius:'16px',
          boxShadow: '5px 10px 5px 5px gray'}}>
          <img src={imgsrc} style={{width:'25%',height:'25%'}}/>
      </div>
    );
};
export default Activities;
